def quantile(self, q=0.5, axis=0, numeric_only=True, interpolation="linear"):
    self._check_percentile(q)

    data = self._get_numeric_data() if numeric_only else self
    axis = self._get_axis_number(axis)
    is_transposed = axis == 1

    if is_transposed and any(data.dtypes == 'datetime64[ns]'):
        data = data.apply(pd.to_numeric)

    if is_transposed:
        data = data.T

    result = data.quantile(
        q=q, axis=1, interpolation=interpolation
    )

    if isinstance(q, list):
        result = result.rename(index={_q: _q for _q in q})
    elif isinstance(q, float):
        result = result.rename(name=q)

    if isinstance(result, pd.DataFrame) and result.shape[1] == 1:
        result = result.iloc[:, 0]

    if is_transposed and isinstance(result, pd.DataFrame):
        result = result.T

    return result
